# Helper function to count mismatches between two strings
def count_mismatches(pattern, substring):
    mismatches = 0
    for i in range(len(pattern)):
        if pattern[i] != substring[i]:
            mismatches += 1
    return mismatches

# Main function for multiple approximate pattern matching
def multiple_approximate_pattern_matching(text, patterns, d):
    result = {}
    for pattern in patterns:
        result[pattern] = []
        # Slide the pattern over the text and check for mismatches
        for i in range(len(text) - len(pattern) + 1):
            substring = text[i:i+len(pattern)]
            if count_mismatches(pattern, substring) <= d:
                result[pattern].append(i)

    # Write the result for each pattern to output.txt
    with open("output.txt", "w") as file:
        for pattern in patterns:
            positions = " ".join(map(str, result[pattern]))
            file.write(f"{pattern}: {positions}\n")

